function App() {
  
const onNewExpense = (data) => {
  console.log(data);
  const newExpenseData = {
    ...data
  }
  console.log(newExpenseData)
  console.log("HIiii")
}

  return (
    <div>
      <NewExpense onNewExpenseDone = {onNewExpense}/>
      <Expenses items = {expenses}></Expenses>
    </div>
  );
}

export default App;
